import React, { useState } from 'react';
import './GridEntry.scss';
import ArrowForwardIosIcon from '@mui/icons-material/ArrowForwardIos';
import ArrowBackIosNewIcon from '@mui/icons-material/ArrowBackIosNew';

const f1Data: { [key: string]: string[] } = {
  "McLaren": ["Lando Norris", "Oscar Piastri"],
  "Ferrari": ["Charles Leclerc", "Lewis Hamilton"],
  "Red Bull": ["Max Verstappen", "Isack Hadjar"],
  "Mercedes": ["George Russell", "Kimi Antonelli"],
  "Aston Martin": ["Fernando Alonso", "Lance Stroll"],
  "Audi": ["Nico Hülkenberg", "Gabriel Bortoleto"],
  "Williams": ["Alex Albon", "Carlos Sainz"],
  "Alpine": ["Pierre Gasly", "Franco Colapinto"],
  "Haas": ["Esteban Ocon", "Oliver Bearman"],
  "Racing Bulls": ["Liam Lawson", "Arvid Lindblad"],
  "Cadillac": ["Sergio Pérez", "Valtteri Bottas"]
};

const voterData = [
  { id: 1, name: "Shailee Patel", team: "McLaren", driver: "Lando Norris", timestamp: "12:37:06" },
  { id: 2, name: "Alex Chen", team: "Ferrari", driver: "Lewis Hamilton", timestamp: "11:20:15" },
];

const GridEntry = () => {
  const [step, setStep] = useState(1); // 1: Objective, 2: Form, 3: Results
  const [formData, setFormData] = useState({ name: '', team: '', driver: '' });

  const handleTeamChange = (e: React.ChangeEvent<HTMLSelectElement>) => {
    setFormData({ ...formData, team: e.target.value, driver: '' });
  };

  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  return (
    <div className="grid-entry-container">
      <div className="section-header" style={{ marginBottom: '40px' }}>
        <span className="section-number">04 //</span>
        <h2 className="section-title">THE PIT WALL</h2>
      </div>

      <div className="f1-terminal" style={{ 
        maxWidth: step === 3 ? '1100px' : '800px',
        boxShadow: '20px 20px 0px #FF7A1A'
      }}>
        {step === 1 && (
          <div className="terminal-content">
            <h2 className="term-header">{'>'} MISSION_OBJECTIVE</h2>
            <p className="term-text">
              Engineering is a race for precision. In the 2026 technical era, data determines the winner. 
              Register your prediction below to join the digital pit wall.
            </p>
            <div className="btn-group">
              <button className="btn-primary" onClick={() => setStep(2)}>
                JOIN THE GRID <ArrowForwardIosIcon style={{ fontSize: '12px' }} />
              </button>
              <button className="btn-secondary" onClick={() => setStep(3)}>VIEW LIVE WALL</button>
            </div>
          </div>
        )}

        {step === 2 && (
          <div className="terminal-content">
            <button className="btn-back" onClick={() => setStep(1)}><ArrowBackIosNewIcon style={{ fontSize: '10px' }} /> BACK</button>
            <h2 className="term-header">{'>'} STRATEGIST_REGISTRATION</h2>
            <div className="form-grid">
              <div className="input-group">
                <label>USER_ID (NAME)</label>
                <input name="name" onChange={handleInputChange} />
              </div>
              <div className="input-group">
                <label>CONSTRUCTOR (TEAM)</label>
                <select name="team" value={formData.team} onChange={handleTeamChange}>
                  <option value="">Select Team</option>
                  {Object.keys(f1Data).map(team => <option key={team} value={team}>{team}</option>)}
                </select>
              </div>
              <div className="input-group">
                <label>PILOT (DRIVER)</label>
                <select name="driver" disabled={!formData.team} onChange={handleInputChange}>
                  <option value="">{formData.team ? 'Select Driver' : 'Select Team First'}</option>
                  {formData.team && f1Data[formData.team].map(d => <option key={d} value={d}>{d}</option>)}
                </select>
              </div>
              <button className="btn-primary" onClick={() => setStep(3)}>LOCK STRATEGY & DEPLOY</button>
            </div>
          </div>
        )}

        {step === 3 && (
          <div className="terminal-content">
            <div className="results-header">
              <h2 className="term-header">{'>'} LIVE_PIT_WALL_FEED</h2>
              <button className="btn-back" onClick={() => setStep(1)}>RESET_COMMS</button>
            </div>
            <div className="voter-grid">
              {voterData.map(vote => (
                <div key={vote.id} className="voter-card">
                  <div className="card-top"><span>{vote.timestamp}</span><span className="accent">{vote.team}</span></div>
                  <div className="voter-name">{vote.name.toUpperCase()}</div>
                  <div className="card-bottom"><span>PILOT</span><span className="accent">{vote.driver}</span></div>
                </div>
              ))}
            </div>
          </div>
        )}
      </div>
    </div>
  );
};

export default GridEntry;
